import { Reading } from "@/hooks/useReadings";

const style = `
html, body {
  width: 100%;
  height: 100%;
}

main {
  width: 100%;
  display: grid;
  gap: 0.3rem;
  grid-template-columns: repeat(3, 400px);
}

.card {
  max-height: 400px;
  min-height: 400px;
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-top: 5rem;
}

.machine {
  width: 100%;
  display: flex;
  justify-content: center;
  padding: 2rem 0rem 0rem 0rem;
  position: relative;
}

.bar-top {
  position: absolute;
  top: -2px;
  left: 45%;
}

.bar-top-left {
  position: absolute;
  top: 14px;
  left: 27%;
}

.bar-left {
  position: absolute;
  top: 49%;
  left: 7%;
}

input {
  max-width: 60px;
  height: 20px;
  border: 2px solid;
  padding: 0.1rem;
  text-align: center;
}

.machine-img {
  width: 50%;
}

.footer {
  width: 100%;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2px;
  flex: 1;
}

.footer div {
  width: 100%;
}

.footer h1 {
  font-size: 16px;
}

label {
  display: flex;
  align-items: center;
}

.status-bar {
  display: flex;
  padding: 1.5rem 0rem;
  justify-content: space-between;
  gap: 5%;
}


.oil-level-img {
  grid-column: 2;
}

.card h1 {
  margin-top: 1rem;
  font-size: 1.5rem;
}

.oil-level-img img {
    min-width: 100%;
    max-width: 100%;
}

header {
  padding: 1rem 0rem; 
}
`;

export const RENDER = (child: string, header: string = "") => `
<html>
    <head>
        <style>${style}</style>
    </head>
    <body>
        <div style="display:flex; width: 100%; padding: 2rem 0rem;">
            <h1 style="margin:0 auto;">Log Sheet Report</h1>
        </div>
        <header>${header}</header>
        <main>
            ${child}
        </main>
    </body>
</html>
`;

const RadioInput = (checked: boolean = false) =>
  `<input type="radio" ${checked ? "checked" : ""} />`;

export const cardTemplate = (
  model: Reading,
  base64Img: string,
  machineName: string
) => `
    <div class="card">
    <div class="status-bar">
      <label>
        ${RadioInput(model.newOptionStatus === "on")}
         ON
      </label>
      <label>
        ${RadioInput(model.newOptionStatus === "off")}
         OFF
      </label>
      <label>
        ${RadioInput(model.newOptionStatus === "isolated")}
         Isolated
      </label>
    </div>
    <div class="machine">
    <img 
        class="machine-img" src="data:image/jpeg;base64,"  />
      <div class="bar-top"><input value="${model.outletPressure}"/>
    </div>
    <div class="bar-top-left"><input value="${model.inletPressure}"/>
    </div>
    <div class="bar-left"><input value="${model.diffPressureIndication}"  />
    </div>
         </div>
  <div class="footer">
    <div class="oil-level-img">
      <img src="data:image/jpeg;base64,${base64Img}" />
    </div>
    <div style="margin-left: 1rem;">
      <h1>Oil level</h1>
      <label>
        Low: 
        ${RadioInput(model.oilPressureStatus === "Low")}
      </label>
      <label>
        Good: ${RadioInput(model.oilPressureStatus === "Good")}
      </label>
    </div>
  </div>
   <h1>${machineName}</h1>
  </div>
`;
